import React from "react";
import { useLocation } from "react-router-dom";
import { connect } from "react-redux";
import { useEffect } from "react";
import {fetchMovieDetail} from "../redux/action"

 const MovieDetail = (props)=>{

const location = useLocation();
// console.log(location.state.id)


useEffect(()=>{

    props.fetchMovieDetail(location.state.id)

},[])




return (
  <div>
    <h1>this is movieDetail</h1>

    <div className="movie">
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/NrJRE678TiU"
        title="YouTube video player"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
    </div>
  </div>
);



}


export default connect(null, {fetchMovieDetail})(MovieDetail)
